import React from 'react';
import './App.css';
import MandateAccessButton from './mandateaccess'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Mandate Access Generator</h1>
        <MandateAccessButton />
      </header>
    </div>
  );
}

export default App;
